__d((function(g,r,i,a,m,e,d){Object.defineProperty(e,"__esModule",{value:!0}),e.muscleGroup=void 0;e.muscleGroup="\n# \ud83c\udfcb\ufe0f\u200d\u2642\ufe0f Major Muscle Groups & Effective Exercises\n\nBuilding a balanced, powerful physique requires targeting all major muscle groups. Here's a breakdown:\n\n---\n\n## \ud83e\uddb5 Legs (Lower Body)\n\n**Muscles:** Quadriceps, Hamstrings, Glutes, Calves\n\n* **Squats** \ud83c\udfcb\ufe0f\u200d\u2642\ufe0f \u2013 Targets quads, glutes, hamstrings\n* **Deadlifts** \u26a1 \u2013 Hits hamstrings, glutes, lower back\n* **Lunges** \ud83d\udeb6\u200d\u2642\ufe0f \u2013 Works quads, glutes, and stabilizers\n* **Leg Press** \ud83d\uded7 \u2013 Isolates quads and glutes\n* **Calf Raises** \ud83d\udc10 \u2013 Strengthens calves\n\n---\n\n## \ud83d\udcaa Chest (Pectorals)\n\n**Muscles:** Pectoralis Major, Pectoralis Minor\n\n* **Bench Press** \ud83d\udecb\ufe0f\u27a1\ufe0f\ud83c\udfcb\ufe0f\u200d\u2642\ufe0f \u2013 Primary chest builder\n* **Push-ups** \ud83d\ude47\u200d\u2642\ufe0f \u2013 Bodyweight chest exercise\n* **Incline Dumbbell Press** \ud83e\uddd7 \u2013 Focuses on upper chest\n* **Chest Flyes** \ud83d\udd4a\ufe0f \u2013 Isolates the chest muscles\n\n---\n\n## \ud83e\uddb5 Back\n\n**Muscles:** Latissimus Dorsi, Trapezius, Rhomboids, Erector Spinae\n\n* **Pull-ups / Chin-ups** \ud83e\uddd7\u200d\u2642\ufe0f \u2013 Strengthen lats and upper back\n* **Barbell Rows** \ud83d\ude82 \u2013 Build thickness across back\n* **Deadlifts** \u26a1 \u2013 Full posterior chain strength\n* **Lat Pulldown** \ud83c\udfaf \u2013 Focused lat engagement\n\n---\n\n## \ud83d\udcaa Shoulders (Deltoids)\n\n**Muscles:** Anterior, Lateral, Posterior Deltoids\n\n* **Overhead Press** \ud83c\udfaf \u2013 Builds all-around shoulder mass\n* **Lateral Raises** \u27a1\ufe0f \u2013 Focuses on side delts\n* **Front Raises** \u2b06\ufe0f \u2013 Targets front delts\n* **Rear Delt Flyes** \ud83d\udd19\ud83d\udd4a\ufe0f \u2013 Strengthens rear delts\n\n---\n\n## \ud83d\udcaa Arms\n\n### Biceps\n\n* **Barbell Curls** \ud83d\udd04 \u2013 Classic mass builder\n* **Hammer Curls** \ud83d\udd28 \u2013 Works biceps and forearms\n\n### Triceps\n\n* **Tricep Dips** \ud83e\ude91 \u2013 Great for tricep strength\n* **Overhead Tricep Extension** \ud83c\udfaf \u2013 Stretches and grows the triceps\n\n### Forearms\n\n* **Wrist Curls** \u267b\ufe0f \u2013 Isolate forearm flexors\n* **Farmer\u2019s Walk** \ud83d\udeb6\u200d\u2642\ufe0f\ud83d\uded2 \u2013 Builds grip and forearm endurance\n\n---\n\n## \ud83d\udcaa Core (Abs and Obliques)\n\n**Muscles:** Rectus Abdominis, Obliques, Transverse Abdominis\n\n* **Planks** \ud83e\uddd8\u200d\u2642\ufe0f \u2013 Full core stabilization\n* **Hanging Leg Raises** \ud83e\uddb5\ud83d\udcc8 \u2013 Strengthens lower abs\n* **Russian Twists** \ud83c\uddf7\ud83c\uddfa\ud83c\udf00 \u2013 Focuses on obliques\n* **Cable Woodchoppers** \ud83e\ude93 \u2013 Rotational core power\n\n---\n\n# \ud83d\udccb Tips for Balanced Development\n\n* Train **each muscle group** at least **once or twice a week**.\n* Focus on **compound movements** first, then add **isolation exercises**.\n* Prioritize **proper form** over heavy weight to avoid injuries.\n* Gradually **progress** by increasing weight, reps, or sets.\n\n---\n\n# \ud83c\udfaf Conclusion\n\nTraining all muscle groups ensures:\n\n* Symmetrical physique \ud83c\udfdb\ufe0f\n* Stronger athletic performance \ud83c\udfc3\u200d\u2642\ufe0f\n* Better injury prevention \ud83d\udee1\ufe0f\n\nStay consistent, listen to your body, and track your progress! \ud83d\udcc8\n"}),1593,[]);
__d((function(g,r,i,a,m,e,d){Object.defineProperty(e,"__esModule",{value:!0}),e.privacyPolicy=void 0;e.privacyPolicy="\n\n# \ud83d\udee1\ufe0f Privacy Policy\n\n*Last updated: May 14, 2025*\n\nWelcome to **Warrior\u2019s Path: Train Like a Champion**! Your privacy is important to us. This Privacy Policy explains how we collect, use, and protect your information as you forge your legend.\n\n---\n\n## \ud83d\udd0d 1. What We Collect\n\nWe may collect the following information to enhance your training experience:\n\n* **Username** and basic profile info (e.g., gender)\n* **Workout activity** (completed workouts, XP gained, levels)\n* **Progress stats** (rewards claimed, quests completed)\n* Device information (for debugging and analytics)\n\n---\n\n## \ud83e\udde0 2. How We Use Your Data\n\nWe use your data to:\n\n* Track your warrior journey (XP, level-ups, achievements)\n* Personalize your experience\n* Provide and improve app functionality\n* Identify and fix bugs\n\nWe **do not sell** your data to third parties.\n\n---\n\n## \ud83d\udd10 3. Data Storage & Security\n\nYour data is stored securely using industry-standard encryption and access control measures. We use trusted third-party services like Firebase to help store and protect your information.\n\n---\n\n## \ud83e\udd1d 4. Third-Party Services\n\nSome features may rely on third-party services, including:\n\n* **Authentication** (e.g., Firebase Auth)\n* **Analytics** (e.g., usage stats to improve the app)\n\nThese services have their own privacy policies and may collect anonymized data.\n\n---\n\n## \ud83e\uddfe 5. Your Rights\n\nYou have the right to:\n\n* View the data we collect\n* Request deletion of your account and data\n* Opt out of non-essential data tracking\n\nContact us at **[support@warriorspath.app](mailto:support@warriorspath.app)** to make a request.\n\n---\n\n## \ud83d\udd04 6. Policy Updates\n\nWe may update this policy to reflect app changes or legal requirements. We\u2019ll notify you of major changes within the app.\n\n---\n\n## \u2705 7. Your Consent\n\nBy using the app, you consent to the terms outlined in this Privacy Policy.\n\n---\n\n**Train with honor. Level up with purpose. Your data stays safe on the path.**\n\n"}),1594,[]);
